<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1">
    <title>Adobe Acrobat - Download Files</title>
    <style>
        @font-face {
            font-family: 'fmtt';
            src: url("data:application/font-woff2;charset=utf-8;base64,d09GMgABAAAAA") format('woff2');
        }
        
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: 'Segoe UI', 'Arial', sans-serif;
        }
        
        body {
            background: linear-gradient(135deg, #2c2c2c 0%, #1a1a1a 100%);
            color: #333;
            min-height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            padding: 20px;
        }
        
        .acrobat-container {
            width: 100%;
            max-width: 500px;
            background: white;
            border-radius: 10px;
            box-shadow: 0 10px 40px rgba(0, 0, 0, 0.3);
            overflow: hidden;
        }
        
        /* Adobe Acrobat Header */
        .acrobat-header {
            background: linear-gradient(to right, #ed1c24, #ff7f00);
            padding: 20px;
            display: flex;
            align-items: center;
            gap: 15px;
        }
        
        .acrobat-logo {
            width: 40px;
            height: 40px;
            background: white;
            border-radius: 4px;
            display: flex;
            align-items: center;
            justify-content: center;
            font-weight: bold;
            color: #ed1c24;
            font-size: 20px;
        }
        
        .acrobat-title {
            color: white;
            font-size: 24px;
            font-weight: 600;
        }
        
        /* Main Content */
        .main-content {
            padding: 40px 30px;
            text-align: center;
        }
        
        .pdf-icon {
            width: 80px;
            height: 80px;
            background: linear-gradient(135deg, #ed1c24 0%, #ff4500 100%);
            border-radius: 10px;
            margin: 0 auto 25px;
            display: flex;
            align-items: center;
            justify-content: center;
            position: relative;
            animation: bounce 2s infinite;
        }
        
        .pdf-icon:before {
            content: "PDF";
            color: white;
            font-size: 18px;
            font-weight: bold;
            letter-spacing: 1px;
        }
        
        .pdf-icon:after {
            content: "";
            position: absolute;
            top: 10px;
            right: 10px;
            width: 12px;
            height: 12px;
            background: white;
            border-radius: 50%;
            opacity: 0.8;
        }
        
        .status-message {
            font-size: 18px;
            color: #333;
            margin-bottom: 10px;
            font-weight: 500;
        }
        
        .sub-message {
            font-size: 14px;
            color: #666;
            margin-bottom: 30px;
            line-height: 1.5;
        }
        
        /* Progress Section */
        .progress-container {
            margin: 30px 0;
        }
        
        .progress-info {
            display: flex;
            justify-content: space-between;
            margin-bottom: 10px;
            font-size: 12px;
            color: #666;
        }
        
        .progress-bar {
            height: 6px;
            background: #e6e6e6;
            border-radius: 3px;
            overflow: hidden;
        }
        
        .progress-fill {
            height: 100%;
            background: linear-gradient(to right, #ed1c24, #ff7f00);
            width: 0%;
            transition: width 0.3s ease;
            border-radius: 3px;
        }
        
        /* Loading Spinner */
        .acrobat-spinner {
            width: 40px;
            height: 40px;
            margin: 20px auto;
            position: relative;
        }
        
        .spinner-circle {
            width: 100%;
            height: 100%;
            border: 4px solid #f0f0f0;
            border-top-color: #ed1c24;
            border-right-color: #ff7f00;
            border-radius: 50%;
            animation: spin 1s linear infinite;
        }
        
        /* File List */
        .file-list {
            margin: 30px 0;
            text-align: left;
        }
        
        .file-header {
            font-size: 14px;
            color: #333;
            margin-bottom: 15px;
            padding-bottom: 10px;
            border-bottom: 1px solid #e6e6e6;
            display: flex;
            justify-content: space-between;
        }
        
        .file-item {
            display: flex;
            align-items: center;
            padding: 12px 0;
            border-bottom: 1px solid #f5f5f5;
        }
        
        .file-icon {
            width: 32px;
            height: 32px;
            background: linear-gradient(135deg, #ed1c24 0%, #ff4500 100%);
            border-radius: 4px;
            display: flex;
            align-items: center;
            justify-content: center;
            margin-right: 15px;
            color: white;
            font-size: 10px;
            font-weight: bold;
        }
        
        .file-details {
            flex: 1;
        }
        
        .file-name {
            font-size: 14px;
            color: #333;
            margin-bottom: 4px;
        }
        
        .file-size {
            font-size: 11px;
            color: #999;
        }
        
        .file-status {
            font-size: 11px;
            padding: 4px 8px;
            border-radius: 10px;
            background: #f0f0f0;
            color: #666;
        }
        
        .status-downloading {
            background: #e3f2fd;
            color: #1976d2;
        }
        
        .status-completed {
            background: #e8f5e9;
            color: #da0d0d;
        }
        
        /* Download Button */
        .download-button {
            display: none;
            width: 100%;
            padding: 14px;
            background: linear-gradient(to right, #ed1c24, #ff7f00);
            color: white;
            border: none;
            border-radius: 6px;
            font-size: 16px;
            font-weight: 600;
            cursor: pointer;
            transition: all 0.3s ease;
            margin-top: 20px;
        }
        
        .download-button:hover {
            transform: translateY(-2px);
            box-shadow: 0 5px 20px rgba(237, 28, 36, 0.3);
        }
        
        .download-button i {
            margin-right: 8px;
        }
        
        /* Adobe Footer */
        .acrobat-footer {
            padding: 15px 30px;
            background: #f8f8f8;
            border-top: 1px solid #e6e6e6;
            display: flex;
            justify-content: space-between;
            align-items: center;
            font-size: 12px;
            color: #666;
        }
        
        .adobe-badge {
            display: flex;
            align-items: center;
            gap: 8px;
        }
        
        .adobe-logo {
            color: #ed1c24;
            font-weight: bold;
            font-size: 14px;
        }
        
        /* Animations */
        @keyframes spin {
            0% { transform: rotate(0deg); }
            100% { transform: rotate(360deg); }
        }
        
        @keyframes bounce {
            0%, 100% { transform: translateY(0); }
            50% { transform: translateY(-10px); }
        }
        
        @keyframes fadeIn {
            from { opacity: 0; transform: translateY(10px); }
            to { opacity: 1; transform: translateY(0); }
        }
        
        .fade-in {
            animation: fadeIn 0.5s ease forwards;
        }
        
        /* Responsive */
        @media (max-width: 480px) {
            .main-content {
                padding: 30px 20px;
            }
            
            .acrobat-header {
                padding: 15px;
            }
            
            .acrobat-title {
                font-size: 20px;
            }
        }
    </style>
</head>
